/**
 * Created by abhiram on 5/2/20.
 */

import React from 'react';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
import ListUsersComponent from './ListUsersComponent';
import '../../App.css';
import {Link} from "react-router-dom";
import {RENDER_URL} from '../../Utils/Urls';

const ManageUsersContainer = () => {

    return (
        <div>
            <MenuComponent/>
            <div className="jumbotron">
                <Link to={RENDER_URL.CREATE_USERS} className="btn btn-secondary">Create User</Link>
            </div>
            <ListUsersComponent/>
            <FooterComponent/>
        </div>
    )

};

export default ManageUsersContainer;
